let initialState= [{
  "infoText": "",
  "infoLink": ""
}]
let information_announcementDetails = (state= null, action) => {
  switch (action.type) {
    case "INFORMATION_ANNOUNCEMENT":
      return action.payload;
    default:
      return {};
  }
}

export { information_announcementDetails };
